import { Link } from 'react-router-dom';


function HelloWorld() {
    return(
        <div>
            <Link to="/hello">Hello</Link> |
            <Link to="/Labs/a3">A3</Link> |
            <Link to="/Kanbas">Kanbas</Link>
            <h1>Hello World!</h1>
        </div>

    );
 };
 export default HelloWorld;
